import React from "react";
import './style.css';

function Square({ value: String }) {
  return <button className="square">value</button>;
}

export default function Board() {
  return (
    <>
      <div className="row">
        <Square />
        <Square />
        <Square />
      </div>
      <div className="row">
        <Square />
        <Square />
        <Square />
      </div>
      <div className="row">
        <Square />
        <Square />
        <Square />
      </div>
    </>
  );
}
